    false,nt"url": null,nt"notes": "This annual narrative report for Aleutian
    Islands (including Simeonof NWR, Bogoslof NWR, and Semidi NWR) and Izembek NWRs
    outlines Refuge accomplishments during the 1968 calendar year. The report begins
    by summarizing the weather conditions, habitat conditions, water conditions, and
    food and cover conditions during the year. Wildlife- including migratory birds,
    upland game birds, big game animals, furbearers, predators, rodents, mammals, raptors,
    and fish- is also covered. The Refuge development and maintenance section discusses
    physical developments and wildfires. Resource management is outlined; topics include
    grazing and commercial fishing. A progress report on field investigations and applied
    research is also provided. The public relations section of the report describes
    recreational uses, Refuge visitors, hunting, violations, and safety. Items of interest
    and an article titled "The Distribution and Biogeography of Zostera marina (Eeelgrass)
    in Alaska" are attached.",nt"license_title": "License Not Specified",nt"extras":
